void mainImage(out vec4 o,vec2 c){
    vec2 r=iResolution.xy,
         m=iMouse.xy/r;
    float t=iTime;
    vec2 n,q,p=(c-0.5*r)/r.y;
    float d=dot(p,p),S=50.,i,a,j;
for(mat2 m=mat2(cos(5.),sin(5.),-sin(5.),cos(5.));j++<300.;){
    p*=m;
    n*=m;
    q=p*S+t*1.+sin(j)+n;
    a+=dot(sin(q)/S,vec2(1.2));
    n-=abs(sin(cos(q)+cos(t)*20.))/r;
    S*=1.0;
}
    o=vec4(clamp(((cos(a*10.)*1.)*vec4(2.*cos(t),1,cos(t),0)+a-10.*abs(a-sin(d+t*.6))/11.).xyz,0.,1.),1);}
